  \"2013-03-16T01:22:16.327168\",\n\t\"name\": \"nevada-aqueous-spring-chemistry\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains aqueous chemistry
  observations compiled by the Nevada Bureau of Mines and Geology, and published as
  a Web feature service for the National Geothermal Data System. Fields in the Aqueous
  Chemistry Observation Content Model will become XML elements in interchange documents
  for WMS simple features provided by a node in the USGIN network. Each feature includes
  an Analysis Name, label, analysis results and Source. The dataset is spatially referenced
  to EPSG: 4326 (for interoperability). The data contained in the submitted dataset
  is available as an Excel Spreadsheet, ESRI service, WMS and WFS service. Link to
  Aqueous Chemistry Observation Content Model: http://www.stategeothermaldata.org/data_delivery/content_models/aqueous_chemistry.\",\n\t\"license_title\":
